import "./TechBullets.scss";

function TechBullets(prop) {
  return (
    <div className="tech_bullets">
      <ul>
        <li>JavaScript</li>
        <li>HTML</li>
        <li>CSS</li>
      </ul>
    </div>
  );
}

export default TechBullets;
